import styled from "styled-components";

function SectionProject() {
  return (
    <Container>
      <Wrap>
        <Title>
          <h2>project</h2>
        </Title>
        <TitleBox>
          <h4>How to work with image</h4>
          <h3>
            Designers must know how to work with images. Designers should think
            about various ways for better visual representations and be able to
            work them. Products and services with great appearance will raise
            confidence and maximize the effects of marketing strategies.
          </h3>
        </TitleBox>
        <ListWrap>
          <ul>
            <ListBox>
              <a href="#">리액트 프로젝트</a>
            </ListBox>
            <ListBox>
              <a href="#">리액트 프로젝트</a>
            </ListBox>
            <ListBox>
              <a href="#">리액트 프로젝트</a>
            </ListBox>
          </ul>
        </ListWrap>
      </Wrap>
    </Container>
  );
}

export default SectionProject;

const Container = styled.div`
  background-color: #eeeeee;
`;

const Wrap = styled.div`
  width: 100%;
  height: 45vw;
  max-width: 1400px;
  margin: 0 auto;
`;

const Title = styled.div`
  margin-top: 140px;
  h2 {
    font-weight: ${({ theme }) => theme.fonts.weightExtra};
    color: ${({ theme }) => theme.colors.black_color};
    margin-bottom: 60px;
  }
`;

const TitleBox = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;

  h4 {
    width: 50%;
    width: 100%;

    font-weight: ${({ theme }) => theme.fonts.weightSemiBold};
    color: #000;
    font-size: 60px;
    margin-top: 20px;
    line-height: 120%;
  }
  h3 {
    width: 70%;
    font-weight: ${({ theme }) => theme.fonts.weightSemiRegular};
    color: #000;
    font-size: ${({ theme }) => theme.fonts.fontRegular};
    line-height: 160%;
    margin-top: 60px;
  }
`;

const ListWrap = styled.div`
  width: 100%;
  height: 50%;

  margin-top: 140px;
  ul {
    width: 100%;
    display: flex;

    text-align: center;
  }
`;

const ListBox = styled.div`
  width: 33.333%;
  height: 500px;
  margin-left: 20px;
  border: 1px solid black;
  transition: all 0.3s;
  :first-child {
    margin-left: 0;
  }
  :hover {
    border-radius: 30%;
  }
`;
